function closeOverlay() {
  const overlay = document.getElementById('overlay');
  overlay.style.display = 'none';
}

function openFigma(figmaLink) {
  window.open(figmaLink, '_blank');
}
document.addEventListener('DOMContentLoaded', function () {
  const slides = document.querySelectorAll('.slide');

  slides.forEach(slide => {
    slide.addEventListener('click', function () {
      // Удалите класс 'active' у всех слайдов
      slides.forEach(s => s.classList.remove('active'));

      // Добавьте класс 'active' только для выбранного слайда
      this.classList.add('active');
    });
  });
});
function Gallery() {
  return (
    <div class="project">
      <com1>
        <div class="carousel">
          <div class="slide_active" onclick="openOverlay('1.png')">
            <img src="1.png" alt="Фотография 1" />
          </div>
          <div class="slide" onclick="openOverlay('2.png')">
            <img src="2.png" alt="Фотография 2" />
          </div>
          <div class="slide" onclick="openOverlay('3.png')">
            <img src="3.png" alt="Фотография 3" />
          </div>
        </div>
        <div class="project-description">
          <h3>Прототип сайта с тремя страницами, содержание формы регистрации и обратной связи</h3>
          <p>Основные инструменты работы c UI/UX аналитикой</p>
          <a href="#" class="view-project-button" onclick="openFigma('https://www.figma.com/file/pOTRoLEe6xi3eivQGumZwm/Untitled?type=design&node-id=0%3A1&mode=design&t=cIrW35bSKqHEXRsU-1')">Посмотреть проект</a>
        </div>
      </com1>
      <com2>
        <div class="project">
          <div class="carousel">
            <div class="slide_active" onclick="openOverlay('4.png')">
              <img src="4.png" alt="Фотография 4" />
            </div>
            <div class="slide" onclick="openOverlay('5.png')">
              <img src="5.png" alt="Фотография 5" />
            </div>
            <div class="slide" onclick="openOverlay('6.png')">
              <img src="6.png" alt="Фотография 6" />
            </div>
          </div>
          <div class="project-description">
            <h3>Создание проекта используя дизайн Figma в качестве макета.</h3>
            <p>Верстка сайтов (HTML5+CSS3)</p>
            <a href="#" class="view-project-button" onclick="openFigma('https://www.figma.com/file/29pRfrzildwmgqr3Xm7mFs/Simple-Starter-Template-v0.1-(Community)?type=design&mode=design')">Посмотреть проект</a>
          </div>
        </div>
      </com2>
    </div>

  )
}
